import { Table, Tag, Space } from "antd";
import { Tabs, Layout } from "antd";

const { TabPane } = Tabs;
const {  Content } = Layout;
function callback(key) {
  console.log(key);
}

const columns = [
  {
    title: "Mã Đơn Hàng",
    dataIndex: "MaHD",
    key: "MaHD",
    render: (text) => <a>{text}</a>,
  },
  {
    title: "Tình trạng",
    dataIndex: "TinhTrang",
    key: "TinhTrang",
  },
  {
    title: "Ngày lập",
    dataIndex: "NgayLap",
    key: "NgayLap",
  },
  {
    title: "Ngày giao",
    key: "NgayGiao",
    dataIndex: "NgayGiao",
  },
  {
    title: "Phí vận chuyển",
    key: "PhiVC",
    dataIndex: "PhiVC",
  },
  {
    title: "Tiki xu",
    key: "TikiXu",
    dataIndex: "TikiXu",
  },
  {
    title: "Tổng tiền",
    key: "TongTien",
    dataIndex: "TongTien",
  },
  {
    title: "Thành Tiền",
    key: "ThanhTien",
    dataIndex: "ThanhTien",
  },
  {
    title: "Ghi chú",
    key: "GhiChu",
    dataIndex: "Sdt",
  },
];

const data = [
  {
    MaKH: "1",
    TenKH: "Tran Uy",
    email: "asdas",
    Sdt: "123213",
  },
  {
    MaKH: "2",
    TenKH: "Nguyen Uy",
    email: "asdas",
    Sdt: "123213",
  },
  {
    MaKH: "3",
    TenKH: "Ho Uy",
    email: "asdas",
    Sdt: "123213",
  },
  {
    MaKH: "1",
    TenKH: "Tran Uy",
    email: "asdas",
    Sdt: "123213",
  },
  {
    MaKH: "2",
    TenKH: "Nguyen Uy",
    email: "asdas",
    Sdt: "123213",
  },
  {
    MaKH: "3",
    TenKH: "Ho Uy",
    email: "asdas",
    Sdt: "123213",
  },
];

function DsHoaDon() {
  return (
    <div>
      <Layout>
        <Content>
            <Tabs onChange={callback} type="card">
              <TabPane tab="Tất cả" key="1">
                <Table columns={columns} dataSource={data} />
              </TabPane>
              <TabPane tab="Chờ xác nhận" key="2">
                <Table columns={columns} dataSource={data} />
              </TabPane>
              <TabPane tab="Đang xử lý" key="3">
                <Table columns={columns} dataSource={data} />
              </TabPane>
              <TabPane tab="Đang vận chuyển" key="4">
                <Table columns={columns} dataSource={data} />
              </TabPane>
              <TabPane tab="Đã giao hàng" key="5">
                <Table columns={columns} dataSource={data} />
              </TabPane>
              <TabPane tab="Đã hủy" key="6">
                <Table columns={columns} dataSource={data} />
              </TabPane>
            </Tabs>
            <br/>
            
        </Content>
      </Layout>
    </div>
  );
}

export default DsHoaDon;
